    return (
        <>
            
            <div className="container addtodiv my-5">
                <form className="container formaddtodiv col-3">
                    <div className="mb-3 d-flex">
                        <label for="NumberofDivisions" className="form-label">Number of Divisions</label>
                        <input type="number" className="form-control" id="NumberofDivisions"  />
                        <button type="submit" className="btn btn-primary">Confirm</button>
                        
                    </div>
                    
                </form>
            </div>
        </>
    )
}
